import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      selectedMenu: 'p'
    }
  }

  render() {
    return (
      <div className="App">
        <h1>Hello World</h1>


        <div className="menu">
          <p className="menu-item" onClick={() => this.setState({ selectedMenu: 'p' })}>About Me</p>
          <p className="menu-item" onClick={() => this.setState({ selectedMenu: 't' })}>Territories</p>
          <p className="menu-item" onClick={() => this.setState({ selectedMenu: 'c' })}>Covid-19</p>
        </div>

        {this.state.selectedMenu === 'p' ?
          <Provinces />
          :
          this.state.selectedMenu === 't' ?
            <Territories />
            :
            <Covid19 />
        }
      </div>
    );
  }
}


export default App;
